import React, { Component } from 'react';

class Card extends Component {
  render() {
    const cardStyling = {
      position: 'relative',
      width: '100%',
      backgroundColor: 'transparent',
      //   backgroundImage: `url(${this.props.img})`,
      visibility: 'visible',
      backgroundPosition: '50%',
      backgroundRepeat: 'no-repeat',
      backgroundSize: 'cover'
    };
    const cardCaptionStyling = {
      backgroundColor: 'linearGradient(rgba(0, 0, 0, 0.1), rgba(0, 0, 0, 0.1))'
    };
    console.log(this.props);
    return (
      <div style={cardStyling}>
        <img src={this.props.img} alt='' />
        <span>{this.props.data.price}</span>
        <span>{this.props.data.address}</span>
        <span>{this.props.data.neighborhood}</span>
        <span>{this.props.data.beds}</span>
        <span>{this.props.data.baths}</span>
        <span>{this.props.data.sq}</span>
      </div>
    );
  }
}

export default Card;
